import { CheckCircle, Circle } from "lucide-react";

function TaskItem({ task, index, toggleTask }) {
  return (
    <div
      className={`flex items-center justify-between p-3 rounded transition ${
        task.done ? "bg-green-100 text-green-700" : "bg-gray-100"
      } mb-2`}
    >
      <div className="flex items-center gap-3">
        <button onClick={() => toggleTask(index)} className="focus:outline-none">
          {task.done ? <CheckCircle className="text-green-500" /> : <Circle className="text-gray-400" />}
        </button>
        <span className={`${task.done ? "line-through" : ""}`}>{task.task}</span>
      </div>
    </div>
  );
}

export default TaskItem;
